function Home() {
  return (
    <div className='home'>
      <div className='home__a'>
        <h2>Your heavy lifting ends here!</h2>
        <p>Are you looking for industry leading contractors that are reliable, quality, and fair priced? Well I guess we couldn't hide forever. See what ICE Contractors can do for your projects with a 2 minute quote!</p>
      </div>
      <div className='home__b'>
        Snow removal & Excavating
      </div>
      <div className='home__c'>
        Expectations
      </div>
      <div className='home_d'>
        Reviews
      </div>
    </div>
  );
}

export default Home;
